require 'set'
# @param {Integer[]} nums
# @return {Integer[][]}
def three_sum(nums)
    result = []
    found = Set.new
    n = nums.length - 1
    nums = nums.sort
    nums.each_with_index do |el, i|
        seen = Hash.new{|h,k| h[k] = -1 }
        #Two Sum
        (i+1).upto(n) do |j|
            val2 = nums[j]
            complement = -el - val2
            if seen[complement] > -1
                triplet = [el, val2, complement].sort
                min = triplet[0]
                max = triplet[2]
                unless found.include? [min, max]
                    found << [min, max]
                    result << triplet
                end
            end
            seen[val2] = j
        end
    end
    result
end

puts three_sum([-4,-2,-2,-2,0,1,2,2,2,3,3,4,4,6,6]) == [[-4,2,2],[-4,1,3],[-4,0,4],[-4,-2,6],[-2,0,2],[-2,-2,4]]
puts three_sum([-1, 0, 1, 2, -1, -4]) == [[-1, 0, 1],[-1, -1, 2]]
